def plot_triple(y1, y2, y3, label):
    if len(y1) == len(y2) == len(y3):
        x = [i for i in range(len(y1))]
        plt.plot(x, y1, color="salmon", alpha=0.6)
        plt.plot(x, y2, color="lightblue", alpha=0.6)
        plt.plot(x, y3, color="palegreen", alpha=0.6)

        p = sp.polyfit(x, y1, deg=50)
        _y1 = sp.polyval(p, x)
        p = sp.polyfit(x, y2, deg=50)
        _y2 = sp.polyval(p, x)
        p = sp.polyfit(x, y3, deg=50)
        _y3 = sp.polyval(p, x)

        plt.plot(x, _y1, color="red", label="dynamic")
        plt.plot(x, _y2, color="blue", label="min commitment")
        plt.plot(x, _y3, color="green", label="max commitment")

        plt.xlabel("Iterations")
        plt.ylabel(label)
        plt.legend(loc="best")
        plt.show()
    else:
        print("Results not comparable, check dimensions.")
        print(len(y1))
        print(len(y2))
        print(len(y3))


